import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Registration from "./pages/Registration"; // Теперь в pages/
import Home from "./pages/Home"; // Теперь в pages/

function App() {
    return (
        <Router>
            <Routes>
                <Route path="/" element={<Home />} />
                <Route path="/register" element={<Registration />} />
            </Routes>
        </Router>
    );
}

export default App;
